        `,details:{title:"WHAT YOU WERE",table:["Your god blessed you with healing hands. <strong>Their silence is deafening in K\xF6r</strong>.","<strong>You were a member of the Reaper council, planning for everyone\u2019s future</strong>. There is no table for you to sit at here.","You studied under the greatest wizards. <strong>Those incantations hold no power in K\xF6r</strong>.","You maintained the great halls; you were no one special. <strong>Now\u2019s your chance to be a Champion</strong>.","A famous warrior admired by many. <strong>You have no adoring fans in this world</strong>.","<strong>Miserable</strong>. You still are, but now you have to deal with extreme heat too."]},traits:[{title:"TWO EYES OPEN",descrip:`
